  [],\n\t\"revision_timestamp\": \"2016-08-04T08:17:17.316803\",\n\t\"name\": \"togiak-national-wildlife-refuge-narrative-report-calendar-year-1991\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Togiak
  National Wildlife Refuge outlines Refuge accomplishments during the 1991 calendar
  year.  The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  the master plan, the management plan, public participation, and research and investigations.
  Refuge administration is outlined; information about personnel, volunteer programs,
  funding, and safety is given. Habitat management is also covered; subjects include
  wetlands, fire management, water rights, and wilderness areas. The wildlife section
  of the report discusses wildlife diversity, endangered and threatened species, waterfowl,
  marsh birds and waterbirds, shorebirds, raptors, game mammals, marine mammals, and
  fisheries resources. The public uses of the Refuge described in this report include
  hunting, fishing, trapping, wildlife observation, outdoor recreation, and law enforcement.
  The equipment and facilities section of the report provides information about rehabilitation,
  major maintenance, equipment replacement, communication systems, and energy conservation.
  Cooperative programs and items of interest are provided at the end.\",\n\t\"license_title\":
